import React from "react";

const list = [
    {
      id: 'a',
      firstname: 'Robin',
      lastname: 'Wieruch',
      year: 1988,
    },
    {
      id: 'b',
      firstname: 'Dave',
      lastname: 'Davidds',
      year: 1990,
    },
  ];


  const User = ({list}) => (
        <ul>
          {(list || []).map(item => (
            <ListItem key={item.id} item={item} />
          ))}
        </ul>
      );

  export default User;
